import { Col, Row } from 'react-bootstrap';
import { Photo } from '../../redux/reducer';

interface Props {
  data: Photo;
}
function MenuItem({ data }: Props) {
  return (
    <Row className="mb-4">
      <Col md={3}>
        <img src={data.thumbnailUrl} width={150} height={150} alt="" />
      </Col>
      <Col md={9}>
        <input
          className="form-control"
          type="text"
          value={data.title}
          style={{ border: 'none', fontSize: '20px', fontWeight: '600' }}
        />
        <p className="mt-3">1231231</p>
      </Col>
    </Row>
  );
}

export default MenuItem;
